import axiosInstance from '../axiosConfig';

export const fetchRecords = async (tableName) => {
  try {
    const response = await axiosInstance.get(`/${tableName}`);
    return response.data.records;
  } catch (error) {
    console.error('Error fetching records:', error);
    throw error;
  }
};



